(function() {
    var searchTimeout;
    $('body').append('<div id="morphsearch-duplicate" style="display:none;">' + $("#morphsearch .morphsearch-content").html() + '<div/>')
    var morphSearch = document.getElementById('morphsearch'),
        input = morphSearch.querySelector('input.morphsearch-input'),
        ctrlClose = morphSearch.querySelector('span.morphsearch-close'),
        isOpen = isAnimating = false,
        // show/hide search area
        toggleSearch = function(evt) {
            // return if open and the input gets focused
            //if (evt.type.toLowerCase() === 'focus' && isOpen) return false;

            var offsets = morphsearch.getBoundingClientRect();
            if (isOpen) {
                classie.remove(morphSearch, 'open');

                // trick to hide input text once the search overlay closes
                // todo: hardcoded times, should be done after transition ends
                if (input.value !== '') {
                    setTimeout(function() {
                        classie.add(morphSearch, 'hideInput');
                        setTimeout(function() {
                            classie.remove(morphSearch, 'hideInput');
                            input.value = '';
                        }, 300);
                    }, 500);
                }

                input.blur();
            } else {
                classie.add(morphSearch, 'open');
            }
            isOpen = !isOpen;
        };

    // events
    input.addEventListener('focus', toggleSearch);
    ctrlClose.addEventListener('click', toggleSearch);
    // esc key closes search overlay
    // keyboard navigation events
    document.addEventListener('keydown', function(ev) {
        var keyCode = ev.keyCode || ev.which;
        if (keyCode === 27 && isOpen) {
            toggleSearch(ev);
        }
    });




    var morphSearch = document.getElementById('morphsearch'),
        input = morphSearch.querySelector('input.morphsearch-input');
    var s = "";
    $(document).on('keypress', function(e) {
        if ($(e.target).prop("tagName") !== "INPUT") {
            var keyCode = e.keyCode || e.which;
            if ((keyCode >= 65 && keyCode <= 90) || (keyCode >= 97 && keyCode <= 122)) {
                classie.add(morphSearch, 'open');
                var ss = $('.morphsearch-input').val();
                s = "";
                s = String.fromCharCode(e.which);
                if (s.match(/[a-zA-Z\.]/)) {

                    $('.morphsearch-input').val(ss);
                    $('.morphsearch-input').focus();
                }
            }
        }
    });

    $('#morphsearch #clear-text').on('click', function() {
        $("#morphsearch #search-btn").val("");

    });

    $('#morphsearch  #search-btn').on('keyup', function() {
        searchResult(this);
    });

    function searchResult(element) {
        var searchStr = $(element).val().trim();;
        if (searchStr.length >= 3) {
            if (searchTimeout != undefined)
                clearTimeout(searchTimeout);
            searchTimeout = setTimeout(function() {
                jsonResult(searchStr)
            }, 500);

        } else {

            resetResult();
        }
    }

    function jsonResult(searchStr) {
        var reqs = new XMLHttpRequest();
        var url = '/bin/incredibleIndia/getSuggestions?searchString=' + searchStr;
        reqs.open('GET', url);
        reqs.onload = function() {
            var reqData = JSON.parse(reqs.responseText);
            reqData = reqData.contents;
            console.log(reqData.destinations);
            var searchStr = $('#morphsearch #search-btn').val().trim();
            if (searchStr.length >= 3) {
                bindData("#search-col-1", reqData.attractions, searchStr);
                bindData("#search-col-2", reqData.destinations, searchStr);
                bindData("#search-col-3", reqData.others, searchStr);
                if (reqData.attractions.length < 1) {


                    $('#search-col-1').hide();



                }
                if (reqData.destinations.length < 1) {

                    $('#search-col-2').hide();

                }
                if (reqData.others.length < 1) {

                    $('#search-col-3').hide();

                }

            } else {

                resetResult();
            }

        }
        reqs.send();
    }

    function bindData(id, items, srchString) {
        var url = "/content/incredibleindia/en/search.html?q=" + srchString;
        var targetBox = $(id).find(".search-media-object");
        targetBox.hide();
        var viewAll = $(id).find(".morph-button");
        viewAll.hide();
        $.each(items, function(index, value) {
            var currentElem = $(targetBox).eq(index);
            currentElem.find('img').attr("src", value.imagePath);
            currentElem.find('img').attr("alt", value.title);
            currentElem.find('img').attr("title", value.title);
            currentElem.find('h3').html(value.title);
            currentElem.find('p').html(value.description);
            currentElem.attr('href', value.path + ".html");

            currentElem.show();

        });
        $.each(items, function(index, value) {
            var morphButton = $(viewAll).eq(index);

            morphButton.find('a').attr("href", url);

            viewAll.show();
        });
    }


    function resetResult() {
        $("#morphsearch .morphsearch-content").html($("#morphsearch-duplicate").html());
    }
})();
