(function($) {
    if (matchMedia('(min-width: 320px)').matches) {

        if ($('#home').data("videourl")) {
            var path = $('#home').data("videourl").toString();
            var fileName = path.substring(path.lastIndexOf("/") + 1, path.lastIndexOf("."));
            path = path.substring(0, path.lastIndexOf("/") + 1);
            $('#home').vide({
                mp4: path + fileName,
                webm: path + fileName,
                ogv: path + fileName,

            }, {
                volume: 0,
                playbackRate: 1,
                muted: true,
                loop: (typeof $('#home').data('loop') == 'undefined' ? true : $('#home').data('loop')),
                autoplay: false,
                posterType: 'jpg', // Poster image type. "detect" — auto-detection; "none" — no poster; "jpg", "png", "gif",... - extensions.
                resizing: true, // Auto-resizing, read: https://github.com/VodkaBears/Vide#resizing
                bgColor: '#7986CB', // Allow custom background-color for Vide div,
            });

            var instance = $('#home').data('vide');
            var videoObj = instance.getVideoObject();
            videoObj.addEventListener('ended', onEndVideo, false);
            document.getElementById('home').addEventListener('mouseover', playOnHover, false);
        }

        function playOnHover() {
            if (videoObj.paused) {
                $('#home').css("background-image", "none ");
                videoObj.currentTime = 0;
                videoObj.play();
            }
        }

        function onEndVideo() {
            $('#home').css({
                "background-image": "url('" + path + fileName + ".jpg')"
            });
        }


    }
})(jQuery);
