	function focusTo() {
	    var focus = getParameterByName('from');
	    var focusElement = $('#slider-thumbs .item div:first-child [data-path="' + focus + '"]');
        if(focusElement.length==0)
            focusElement = $('#slider-thumbs .item [data-path="' + focus + '"]');
        console.log(focusElement);
	    if (focusElement.length > 0) {
	        $('html, body').animate({
	            scrollTop: $('#alsovisiting-carousel').offset().top - 180
	        }, 800);

	        focusElement.trigger('click');
	        console.log($(focusElement[focusElement.length - 1]).closest('.item').data("index"));
	        $('.slider_background').carousel($(focusElement[focusElement.length - 1]).closest('.item').data("index"))
	    }
	}

	function getParameterByName(name, url) {
	    if (!url) url = window.location.href;
	    name = name.replace(/[\[\]]/g, "\\$&");
	    var regex = new RegExp("[?&]" + name + "(=([^&#]*)|&|#|$)"),
	        results = regex.exec(url);
	    if (!results) return null;
	    if (!results[2]) return '';
	    return decodeURIComponent(results[2].replace(/\+/g, " "));
	}
